import List from './list.jsx';
import Panel from './panel.jsx';
import FriendList from './friendList.jsx';
import React from 'react';
var client;
class Layout extends React.Component
{
	componentDidMount()
	{
		const url = "http://127.0.0.1:5000/loggedIn";
		//const url = "https://nuclei-message.herokuapp.com";
		client = socketClient(url, {transports: ['websocket', 'polling', 'flashsocket']});
	
	}
	render()
	{
		return (<div> 
			<FriendList client = {this.props.client} list = {this.props.user.friendList} />
			<List client = {this.props.client} user = {this.props.user} />
			<Panel client = {this.props.client} username = {this.props.user.username} />
		</div>);
	}
}

export default Layout;
